import React from "react";
import { HomePage } from "./Pages/HomePage/HomePage";
import { MatchesPage } from "./Pages/MatchesPage/MatchesPage";

export default class App extends React.Component {

  state = {
    telaAtual: "PaginaInicial"
  }

  escolherTela = () => {
    switch (this.state.telaAtual) {
      case "paginaInicial":
        return <HomePage />
      case "paginaMatch":
        return <MatchesPage />
      default:
        return <HomePage />
    }
  }

  muedarTela = (nomeTela) => {
    this.setState({ telaAtual: nomeTela })
  }

  render() {
    return (
      <div>
        <button onClick={() => this.muedarTela("paginaInicial")}>paginaInicial</button>
        <button onClick={() => this.muedarTela("paginaMatch")}>paginaMatch</button>
        {this.escolherTela}
      </div>
    )
  }

}
